Attorney Patricia M. Padurean in court.   Defendant Marcus N Sims did not appear.   Kevin Michael Osborne appeared for the State of Wisconsin.  Attorney Padurean advises the Court the Defendant is on his way to Court and is running late.    The Court recalls the case.  The Defendant has paid up front restitution and the State filed an amended information.    Defendant enters a guilty plea to Count 15 of the amended information.  Court finds defendant guilty.


  The Defendant was sentenced to the following:

Count #15:

IMPOSED AND STAYED SENTENCE OF:   

5 MONTHS JAIL;

TERM OF PROBATION:  1 YEAR; (probation may be transferred to Milwaukee);

CONDITIONS OF PROBATION:  
*Follow through with any treatment and/or counseling recommended by Agent;
*No contact with:  co-actors or Walgreens listed in criminal complaint;
*DNA sample to be provided if not yet previously done.
*Perform 60 Hours Community Service.

RESTITUTION:  $70.00 (paid up front, balance set at zero);

COURT COSTS:  $253.00 (to be paid as a condition of probation);

DNA SURCHARGE:  $200.00 (to be paid as a condition of probation);

CONDITION TIME: 30 Days, STAYED; to be used at agent's discretion.  Agent to determine with or without non working hours.
